function getFechaActual() {
    //instancio la fecha del dia de hoy
    var d = new Date();
    var curr_date = d.getDate();
    var curr_month = d.getMonth() + 1;
    var curr_year = d.getFullYear();
    var date_ref = curr_date + '-' + curr_month + '-' + curr_year;
    return date_ref;
}
function border_table_reporte() {

    var objLayout = {};
    objLayout['hLineWidth'] = function (i) {
        return .5;
    };
    objLayout['vLineWidth'] = function (i) {
        return .5;
    };
    objLayout['hLineColor'] = function (i) {
        return '#aaa';
    };
    objLayout['vLineColor'] = function (i) {
        return '#aaa';
    };
    objLayout['paddingLeft'] = function (i) {
        return 4;
    };
    objLayout['paddingRight'] = function (i) {
        return 4;
    };

}
function encabezado(doc, letraHeaderTamano) {
    doc.styles['tableHeader'] = {
        bold: !0,
        fontSize: letraHeaderTamano,
        color: 'white',
        fillColor: '#17a3db'
    }

}
function pie(doc) {
    doc['footer'] = (function (page, pages) {
        return {
            columns: [
                {
                    aligment: 'left',
                    text: 'Descargado el ' + getFechaActual()
                },
                {
                    alignment: 'right',
                    text: [
                        { text: "Página " + page.toString(), italics: true },
                        ' de ',
                        { text: pages.toString(), italics: true }
                    ]
                }
            ],
            margin: [20, 10]
        }
    })
}


