function tituloReporte(doc, filtro) {

  
    switch (filtro) {
            case 7:
                titulo= "Trámites Iniciados- IOMA";
                break;
            case 1:
                titulo="Trámites Aprobados- IOMA";
                break;
            case 2:
                titulo= "Trámites Rechazados- IOMA";
                break;
            case 4:
                titulo = "Trámites Pendientes de auditoría- IOMA";
                break;
            case 8:
                titulo ="Trámites Pendientes de visado- IOMA";
                break;
            case 6:
                titulo = "Trámites Observados - IOMA";
                break;
            case 9:
                titulo = "Trámites en Directorio Con Auditoría Médica Favorable - IOMA";
                break;
            case 10:
                titulo = "Trámites en compras - IOMA";
            break;
            case 11:
                titulo = "Trámites en DGP Con Auditoría Médica Favorable - IOMA";
                break;
            case 12:
                titulo = "Trámites en DGP Con Auditoría Médica Defavorable - IOMA";
                break;
            case 13:
                titulo = "Trámites en Directorio Con Auditoría Médica Defavorable - IOMA";
                break;
            case 14:
                titulo = "Trámites con Orden de Provisión - IOMA";
                break;
            case 15:
                titulo = "Trámites Ad Referendum - IOMA";
                break;
            case 16:
                titulo = "Trámites Denegados por Directorio - IOMA";
                break;
   
        }
    
    doc.content.splice(0, 1, {
        text: [{
            text: titulo.toUpperCase(),
            bold: true,
            fontSize: 16
        }],
        margin: [0, 0, 0, 12],
        alignment: 'center'
    });
}